webpackJsonp([9,429],{1371:function(e,n,s){e.exports={frontmatter:s(372),content:s(2551)}},2551:function(e,n,s){e.exports="<section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <p>En viktig del av det å lage app-er er å utforme skjerminnholdet, dvs. alt app-en inneholder av grafikk, knapper, lister, osv. Formålet til denne leksjonen er å lære hvordan du kan bruke <strong>FXML</strong> for å lage skjerminnhold, og <strong>to måter</strong> å lage slikt innhold. I tillegg skal du lære hvordan du får app-en til å last inn og vise frem innholdet i FXML-filer. App-en er ikke så komplisert, den skal bare vise frem logoene til Kodeklubben og NTNU (eller andre logoer, hvis du ønsker det):</p> <table> <thead> <tr> <th style=text-align:center>Kodeklubben</th> <th style=text-align:center>NTNU</th> </tr> </thead> <tbody> <tr> <td style=text-align:center><img src="+s(3297)+" style=margin:20px;height:168px /></td> <td style=text-align:center><img src="+s(3303)+" style=margin:20px;height:168px /></td> </tr> </tbody> </table> <p>I leksjonen <a href=../helloworld/helloworld.html>Hello world</a> lærte du om hvordan du kan lage en app som viste et vindu med et tekst-objekt (av type <strong>Text</strong>). Da skrev du Java-kode som <em>laget</em> tekst-objektet, <em>satte grafiske egenskaper</em> for tekst-objektet og <em>la det til</em> app-vinduet. Slik kode kan fort bli lang og uoversiktlig, og det kan være vanskelig å skrive kode som har ønsket effekt og se for seg hvordan skjerminnholdet vil bli seende ut.</p> <p>For å gjøre arbeidet med skjerminnhold enklere, så finnes det en egen kode-type kalt <strong>FXML</strong> for å lage skjerminnhold. FXML ligner på HTML ved at det bruker XML-elementer, f.eks. <code>&lt;Text ...&gt; ... &lt;/Text&gt;</code> og attributter, f.eks. <code>fill=&quot;blue&quot;</code> for å beskrive innholdet. Når en skal lage FXML-filer, kan en enten redigere FXML som tekst i en egen FXML-editor eller bruke en egen tegne-app som leser og skriver FXML-filer. Vi skal se på begge disse teknikkene i denne leksjonen.</p> </section> <section class=activity id=steg-1-opprette-app-pakke-app-klasse-og-fxml-fil> <h1 class=activity id=steg-1-opprette-app-pakke-app-klasse-og-fxml-fil>Steg 1: Opprette app-pakke, app-klasse og FXML-fil</h1> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_0><label for=cbx_0> Lag først en ny app-pakke og app-klasse som forklart i <a href=../helloworld/helloworld.html>Hello world-leksjonen</a>. Bruk <strong>fxmllogo</strong> som navn på pakken og <strong>FxmlLogoApp</strong> som navn på app-klassen.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_1><label for=cbx_1> Høyreklikk på <strong>fxmllogo</strong>-pakken og velg <code>New &gt; Other...</code> så du får opp en liste med såkalte <em>veivisere</em> (eng: <em>wizards</em>). Vi skal bruke den som heter <strong>New FXML Document</strong>. Det enkleste er å skrive inn 'fx' i søkefeltet, for å snevre inn utvalget:</label></p> <figure><img src="+s(3304)+' alt="" title="New FXML document"></figure> <p>Trykk <code>Next</code> for å velge veiviseren. Du vil da få opp følgende skjema:</p> <figure><img src='+s(3305)+' alt="" title="New FXML file"></figure> <p>Fyll inn <code>FxmlLogoApp</code> og trykk <code>Finish</code>. Du vil da få opp en FXML-editor med den nye FXML-fila:</p> <figure><img src='+s(3301)+' alt="" title="Initial FxmlLogoApp.fxml"></figure> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_2><label for=cbx_2> Denne FXML-en gir bare et tomt panel (av typen <strong>AnchorPane</strong>), så for å få noe å jobbe med, så trenger vi Rediger teksten slik at den blir som følger:</label></p> <pre><code class=xml></code></pre> </li> </ul> <anchorpane xmlns:fx=http://javafx.com/fxml/1 prefwidth=500 prefheight=400> <rectangle layoutx=100 layouty=20 width=80 height=80 fill=black arcwidth=25 archeight=25 /> <text layoutx=140 layouty=60 text=k fill=white> <font> <font name=Courier size=72 /> </font> </text> <circle layoutx=150 layouty=150 radius=40 fill=blue /> <text layoutx=10 layouty=120 text=NTNU> <font> <font name=Arial size=36 /> </font> </text> </anchorpane> ``` <p>FXML-editoren har samme type kode-komplettering som Java-editoren. Når du f.eks. har skrevet inn <code>&lt;Rect</code>, kan du trykk ctrl-mellomrom og editoren vil både fylle ut resten av <strong>Rectangle</strong>-navnet og legge til en import-setning øverst i fila (tilsvarende import-setningen i Java):</p> <p><code>&lt;?import javafx.scene.shape.Rectangle?&gt;</code></p> <p>(Hvis du ikke bruker kode-kompletteringsfunksjonen, så må du skrive inn import-setningen selv.) Tilsvarende kan du bruke kode-komplettering på attributt-navnene <strong>layoutX</strong>, <strong>layoutY</strong>, <strong>width</strong>, <strong>height</strong>, <strong>fill</strong> osv.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_3><label for=cbx_3> Mens du redigerer FXML-koden, så kan det være kjekt å se hvordan innholdet vil bli seende ut, når det lastes inn og vises frem. Eclipse har et eget panel kalt <strong>JavaFX preview</strong> som hele tiden laster inn FXML-koden du redigerer og viser frem innholdet. Dette åpnes ved å velge <code>Window &gt; Show View...</code> og så finne panelet i lista. Bruk søkefeltet for å filtrere lista (skriv \'pre\', så panelet blir enklere å finne.</label></p> <figure><img src='+s(3300)+' alt="" title="FXML-editor med preview-panel"></figure> <p>Som du ser så inneholder FXML-fila allerede mange av de grafiske elementene som trengs for å lage begge logoene, men ikke alle. Din jobb blir å justere på FXML-koden, så logoene blir omtrent som vist øverst i denne leksjonen.</p> </li> </ul> <section id=litt-om-fxml> <h2 id=litt-om-fxml>Litt om FXML</h2> <p>Du har kanskje kjent igjen mange av ordene i FXML-fila fra Java-koden du skrev i <a href=../helloworld/helloworld.html>Hello world-leksjonen</a>, og det er ikke tilfeldig. Enkelt sagt så tilsvarer elementnavnene i FXML-koden (ordet etter <code>&lt;</code> og <code>&lt;/</code>), f.eks. <strong>Text</strong> og <strong>Rectangle</strong> Java-klasser, og attributtnavnene tilsvarer egenskaper, f.eks. <strong>layoutX</strong>, <strong>width</strong> og <strong>fill</strong>. Det er også noen elementnavn som tilsvarer egenskaper, f.eks. <strong>font</strong>. Når FXML-koden blir lest inn, så vil hvert element som tilsvarer en Java-klasse bli til en instans (et Java-objekt) av den klassen, og hvert attributt bli brukt til å sette en egenskap, som om en brukte tilsvarende <strong>set</strong>-metode. Følgende Java- og FXML-kode betyr omtrent det samme:</p> <pre><code class=java>Circle circle = <span class=hljs-keyword>new</span> Circle();\ncircle.setLayoutX(<span class=hljs-number>150</span>);\ncircle.setLayoutY(<span class=hljs-number>150</span>);\ncircle.setRadius(<span class=hljs-number>40</span>);\ncircle.setFill(Color.BLUE);\n</code></pre> <pre><code class=xml><span class=hljs-tag>&lt;<span class=hljs-name>Circle</span> <span class=hljs-attr>layoutX</span>=<span class=hljs-string>"150"</span> <span class=hljs-attr>layoutY</span>=<span class=hljs-string>"150"</span> <span class=hljs-attr>radius</span>=<span class=hljs-string>"40"</span> <span class=hljs-attr>fill</span>=<span class=hljs-string>"blue"</span>/&gt;</span>\n</code></pre> <p>Noen typer objekter, f.eks. paneler (typene <strong>Pane</strong>, <strong>HBox</strong>, <strong>VBox</strong> og <strong>AnchorPane</strong>), <em>inneholder</em> andre objekter. I Java-koden må en legge den ene til <strong>children</strong>-lista til den andre, mens en i FXML legger det ene elementet inni det andre:</p> <pre><code class=java>Pane pane = <span class=hljs-keyword>new</span> Pane();\nCircle circle = <span class=hljs-keyword>new</span> Circle();\n...\npane.getChildren().add(circle);\n</code></pre> <pre><code class=xml><span class=hljs-tag>&lt;<span class=hljs-name>Pane</span>&gt;</span>\n  <span class=hljs-tag>&lt;<span class=hljs-name>Circle</span> <span class=hljs-attr>layoutX</span>=<span class=hljs-string>"150"</span> <span class=hljs-attr>layoutY</span>=<span class=hljs-string>"150"</span> <span class=hljs-attr>radius</span>=<span class=hljs-string>"40"</span> <span class=hljs-attr>fill</span>=<span class=hljs-string>"blue"</span>/&gt;</span>\n<span class=hljs-tag>&lt;/<span class=hljs-name>Pane</span>&gt;</span>\n</code></pre> </section> </section> <section class=activity id=steg-2-apne-og-redigere-fxml-fil-med-scenebuilder> <h1 class=activity id=steg-2-apne-og-redigere-fxml-fil-med-scenebuilder>Steg 2: Åpne og redigere FXML-fil med SceneBuilder</h1> <p>Det går greit å bruke FXML-editoren for enkel redigering (eller mer kompliserte ting, når en får erfaring), men det finnes et enklere alternativ, nemlig en grafisk editor kalt <strong>SceneBuilder</strong>. En kan faktisk åpne og redigere FXML-fila direkte i JavaFX Scene Builder (ofte bare kalt SceneBuilder), siden den bruker FXML som lagringsformat.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_4><label for=cbx_4> Høyreklikk på FXML-fila og velg <code>Open with SceneBuilder</code></label></p> <figure><img src='+s(3306)+' alt="" title="Åpne med SceneBuilder"></figure> <p>Hvis du har installer SceneBuilder riktig, så skal du etter litt venting få opp følgende</p> <figure><img src='+s(3307)+' alt="" title="FxmlLogoApp.fxml åpnet med SceneBuilder"></figure> <p>Som du ser så inneholder panelet i midten de samme grafiske elementene som JavaFX Preview-panelet. Her kan du imidlertid <em>redigere</em> på dem, ved å velge, dra og slippe, som i vanlige tegneprogrammer.</p> <p>Nederst til venstre ser du trestrukturen av objekter, med et panel (<strong>AnchorPane</strong>) som inneholder et rektangel (<strong>Rectangle</strong>), en sirkel (<strong>Circle</strong>) og to tekst-objekter (<strong>Text</strong>).</p> <p>Øverst til venstre ser du en kategorisert liste med elementer som kan dras og slippes inn i redigeringspanelet i midten. I figuren vises bare såkalte <strong>Containers</strong>, som inneholder andre elementer, men (hvis du scroller) lenger ned finner du bl.a. <strong>Controls</strong> (interaktive elementer) og <strong>Shapes</strong> (grafiske elementer). Prøv å finne <strong>Line</strong>-typen og dra og slipp den litt til høyre for det svarte rektangelet. Hvis du vil endre på hvordan streken ser ut, så kan du redigere ulike <em>egenskaper</em> i panelet til høyre. Prøv f.eks. å gjøre streken tykkere (<strong>Stroke Width</strong> = 10), endre fargen til grønn (<strong>Stroke</strong> = #569900) og enden til avrundet (<strong>Stroke Line Cap</strong> = <strong>ROUND</strong>). Da skal det se omtrent slik ut:</p> <figure><img src='+s(3308)+' alt="" title="FxmlLogoApp.fxml åpnet med SceneBuilder"></figure> <p>Dette er omtrent de grafiske elementen du trenger for å lage Kodeklubben- og NTNU-logoene. Prøv å bruke redigeringsmulighetene til å få tegningen til å bli seende omtrent slik ut:</p> <figure><img src='+s(3309)+' alt="" title="Logoer redigert med SceneBuilder"></figure> <p>Her er noen tips om nyttige redigeringsfunksjoner som du kan bruke for å få laget og redigert grafikken:</p> <ul> <li>Du kan raskt lage en kopi (duplisere) et element med <code>Edit &gt; Duplicate</code></li> <li>Du kan runde av hjørnene på et rektangel ved å endre <strong>Arc Height</strong> og <strong>Arc Width</strong></li> <li>Når du klikker på <strong>Stroke</strong>- og <strong>Fill</strong>-egenskapene, så kommer det opp et nytt vindu med mulighet til å velge farge på flere måter (se under til venstre)</li> <li>Tilsvarende kan du stille inn navn og størrelsen på font-en til tekst-objekter ved å klikke på <strong>Font</strong>-egenskapen (se under til høyre)</li> </ul> <table> <thead> <tr> <th style=text-align:center>Valg av farge</th> <th style=text-align:center>Valg av font</th> </tr> </thead> <tbody> <tr> <td style=text-align:center><img src='+s(3298)+' alt=""></td> <td style=text-align:center><img src='+s(3299)+' alt=""></td> </tr> </tbody> </table> <p>Spesielt fin-innstillingen av plassering og dimensjoner kan være vanskelig. Nede til høyre i SceneBuilder-vinduet finner du egenskaper med kategorien <strong>Layout</strong>, bl.a. koordinater og størrelse. Akkurat hvilke egenskaper du kan endre avhenger av hvilket grafisk element som er valgt. I figuren under ser du hva som kan endre på et rektangel.</p> <table> <thead> <tr> <th style=text-align:center>Layout-egenskaper</th> <th></th> </tr> </thead> <tbody> <tr> <td style=text-align:center><img src='+s(3302)+' alt=""></td> <td>Det er egentlig disse egenskapene du endrer, når du velger, drar og slipper de grafiske elementene og de små hjørne-boksene. Ved å redigere tallene, så kan du styre dem helt presist.</td> </tr> </tbody> </table> </li> </ul> </section> <section class=activity id=steg-3-fa-appen-til-a-vise-frem-innholdet-i-fxml-fila> <h1 class=activity id=steg-3-fa-appen-til-a-vise-frem-innholdet-i-fxml-fila>Steg 3: Få appen til å vise frem innholdet i FXML-fila </h1> <p>Det siste trinnet i denne leksjonen er å få app-en til å vise frem det grafiske innholdet i app-vinduet. For å få dette til må du redigere koden i app-klassen din, som du laget i trinn én og heter <strong>FxmlLogoApp</strong>.</p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_5><label for=cbx_5> Husk å lagre FXML-fila i SceneBuilder før du går tilbake til Eclipse.</label></li> <li class=task-list-item><input type=checkbox id=cbx_6><label for=cbx_6> Klikk i FXML-editoren. Den skal da vise frem det nye innholdet, som er resultatet av all redigeringen du gjorde i SceneBuilder.</label></li> <li class=task-list-item><input type=checkbox id=cbx_7><label for=cbx_7> Det er greit å gjøre endringer rett i FXML-koden i editor. Når du går tilbake til SceneBuilder, så sjekk om du ser de samme endringene der. Hvis ikke så må du kanskje lukke den og åpne den igjen med <code>Open with SceneBuilder</code>.</label></li> <li class=task-list-item><input type=checkbox id=cbx_8><label for=cbx_8> Velg editoren med <strong>FxmlLogoApp</strong>-klassen i (eller åpne den ved å dobbel-klikke på <strong>FxmlLogoApp.java</strong>) og rediger slik at du får følgende kode:</label><pre><code class=java><span class=hljs-keyword>package</span> fxmllogoapp;\n\n<span class=hljs-keyword>import</span> java.io.IOException;\n\n<span class=hljs-keyword>import</span> javafx.application.Application;\n<span class=hljs-keyword>import</span> javafx.fxml.FXMLLoader;\n<span class=hljs-keyword>import</span> javafx.scene.Scene;\n<span class=hljs-keyword>import</span> javafx.scene.layout.Pane;\n<span class=hljs-keyword>import</span> javafx.stage.Stage;\n\n<span class=hljs-keyword>public</span> <span class=hljs-class><span class=hljs-keyword>class</span> <span class=hljs-title>FxmlLogoApp</span> <span class=hljs-keyword>extends</span> <span class=hljs-title>Application</span> </span>{\n\n  <span class=hljs-function><span class=hljs-keyword>public</span> <span class=hljs-keyword>void</span> <span class=hljs-title>start</span><span class=hljs-params>(Stage primaryStage)</span> <span class=hljs-keyword>throws</span> IOException </span>{\n    FXMLLoader fxmlLoader = <span class=hljs-keyword>new</span> FXMLLoader(FxmlLogoApp.class.getResource(<span class=hljs-string>"FxmlLogoApp.fxml"</span>));\n    Pane root = fxmlLoader.load();\n        primaryStage.setScene(<span class=hljs-keyword>new</span> Scene(root));\n        primaryStage.show();\n  }\n\n  <span class=hljs-function><span class=hljs-keyword>public</span> <span class=hljs-keyword>static</span> <span class=hljs-keyword>void</span> <span class=hljs-title>main</span><span class=hljs-params>(String[] args)</span> </span>{\n    launch(FxmlLogoApp.class, args);\n  }\n}\n</code></pre> </li> </ul> <pre><code>\n  Trikset her er å lage et **FXMLLoader**-objekt (første linje i start-metoden, og <span class=hljs-keyword>be </span>denne laste inn FXML-fila med load-metoden (<span class=hljs-keyword>andre </span>linje).\n- [ ] Kjør app-en ved å høyre-klikke på fila eller i editoren og velge `Run as &gt; <span class=hljs-keyword>Java </span>Application`. Da skal det (etter litt venting) dukke opp et vindu som dette:\n\n  ![](run-FxmlLogoApp-as-<span class=hljs-keyword>java-application.png)\n</span>\n<span class=hljs-comment># Hva har du lært?</span>\n\n+ lage en FXML-fil med Eclipse sin veiviser\n+ redigere FXML i Eclipse sin FXML-editor.\n+ se forhåndsvisning av FXML-innholdet i <span class=hljs-keyword>JavaFX </span>Preview-panelet\n+ åpne FXML-fila i <span class=hljs-keyword>JavaFX </span><span class=hljs-keyword>Scene </span><span class=hljs-keyword>Builder </span>med `Open with <span class=hljs-keyword>SceneBuilder`\n</span>+ legge nye elementer til FXML-fila ved å dra og slippe fra <span class=hljs-keyword>SceneBuilder </span>sin paletten\n+ redigere grafiske egenskaper i <span class=hljs-keyword>SceneBuilder\n</span>+ skrive app-kode som laster inn og viser frem FXML-fila i et app-vindu\n\nI leksjonen KalkulatorFX (to <span class=hljs-keyword>be </span>continued) vil du lære hvordan du kan koble FXML-koden til <span class=hljs-keyword>Java-koden </span>og gjøre app-en levende (interaktiv)!\n</code></pre> </section> '},3297:function(e,n){e.exports="data:image/png;base64,"},3298:function(e,n,s){e.exports=s.p+"_/oppgaver/src/javafx/fxmllogo/color-picker.ed8b1b.png"},3299:function(e,n,s){e.exports=s.p+"_/oppgaver/src/javafx/fxmllogo/font-picker.6e7624.png"},3300:function(e,n,s){e.exports=s.p+"_/oppgaver/src/javafx/fxmllogo/fxml-editor-with-preview-pane.8866a4.png"},3301:function(e,n,s){e.exports=s.p+"_/oppgaver/src/javafx/fxmllogo/initial-FxmlLogoApp.fxml.362a45.png"},3302:function(e,n,s){e.exports=s.p+"_/oppgaver/src/javafx/fxmllogo/layout-properties.436136.png"},3303:function(e,n){e.exports="data:image/gif;base64,"},3304:function(e,n,s){e.exports=s.p+"_/oppgaver/src/javafx/fxmllogo/new-fxml-document.1769ba.png"},3305:function(e,n,s){e.exports=s.p+"_/oppgaver/src/javafx/fxmllogo/new-fxml-file-wizard.01b114.png"},3306:function(e,n,s){e.exports=s.p+"_/oppgaver/src/javafx/fxmllogo/open-with-scenebuilder.b7698e.png"},3307:function(e,n,s){e.exports=s.p+"_/oppgaver/src/javafx/fxmllogo/scene-builder-FxmlLogoApp-1.bcdffb.png"},3308:function(e,n,s){e.exports=s.p+"_/oppgaver/src/javafx/fxmllogo/scene-builder-FxmlLogoApp-2.fe3539.png"},3309:function(e,n,s){e.exports=s.p+"_/oppgaver/src/javafx/fxmllogo/scene-builder-FxmlLogoApp-3.294491.png"}});